// practice with rainboyimport java.io.*;import java.util.*; public class CF154B extends PrintWriter {	CF154B() { super(System.out); }	Scanner sc = new Scanner(System.in);	public static void main(String[] $) {		CF154B o = new CF154B(); o.main(); o.flush();	} 	static final int A = 100000;	int[] yy = new int[A + 1];	boolean[] used = new boolean[A + 1];	int test(int x) {		for (int a = 2; a <= x / a; a++)			if (x % a == 0) {				if (yy[a] != 0)					return yy[a];				while (x % a == 0)					x /= a;			}		if (x > 1 && yy[x] != 0)			return yy[x];		return 0;	}	void set(int x, int y) {		for (int a = 2; a <= x / a; a++)			if (x % a == 0) {				yy[a] = y;				while (x % a == 0)					x /= a;			}		if (x > 1)			yy[x] = y;	}	void main() {		int n = sc.nextInt();		int m = sc.nextInt();		while (m-- > 0) {			String s = sc.next();			int x = sc.nextInt();			if (s.charAt(0) == '-') {				if (!used[x])					println("Already off");				else {					used[x] = false;					set(x, 0);					println("Success");				}			} else {				if (used[x])					println("Already on");				else {					int y = test(x);					if (y != 0)						println("Conflict with " + y);					else {						used[x] = true;						set(x, x);						println("Success");					}				}			}		}	}}
